ill Debit or credit card information\n\t|cardNumber\t|nameOnCard|\texpirationMonth|\texpirationYear|\tsecurityCode|\n\t|1234567890123456\t|Test Test\t|8\t|2042\t|123|\n\tAnd User click on Add your card button\n\tThen a message should be displayed 'Payment Method added successfully'\n\n\t@editPayment\nScenario: Verify User can edit Debit or Credit card\n\tWhen User click on Account option\n\tAnd User click on Edit option of card section\n\tAnd user edit information with below data\n\t|cardNumber\t|nameOnCard|\texpirationMonth|\texpirationYear|\tsecurityCode|\n\t|9876543210987654\t|Testtest McTest\t|9\t|2041\t|321|\n\tAnd user click on Update Your Card button\n\tThen a message should be displayed 'Payment Method updated Successfully'\n\n\t@removeCard\nScenario: Verify User can remove Debit or Credit card\n\tWhen User click on Account option\n\tAnd user click on remove option of card section\n\tThen payment details should be removed\n\t\n\t@addAddress\nScenario: Verify User can add an Address\n\tWhen User click on Account option\n\tAnd User click on Add address option\n\tAnd user fill new address form with below information\n\t|country\t|fullName\t|phoneNumber\t|streetAddress\t|apt\t|city\t|state\t|zipCode\t|\n\t|United States|Test Test\t|1234567890\t|12345 Street Ave\t|3\t|Cityville\t|California\t|12345|\n\tAnd User click on Add Your Address button\n\tThen a message should be displayed 'Address Added Successfully'\n\t\n\t@editAddress\nScenario: Verify User can edit an Address added on account\n\tWhen User click on Account option\n\tAnd User click on edit address option\n\tAnd user fill new address form with below information\n\t|country\t|fullName\t|phoneNumber\t|streetAddress\t|apt\t|city\t|state\t|zipCode\t|\n\t|Russian Federation\t|Testtest McTest\t|9876543210\t|54321 Avenue Ave\t|2\t|Townsville\t|Altai Krai\t|54321|\n\tAnd User click update Your Address button\n\tThen a message should be displayed 'Address updated Successfully'\n\t\n\t@removeAddress\nScenario: Verify User can remove Address from Account\n\tWhen User click on Account option\n\tAnd User click on remove option of Address section\n\tThen Address details should be removed","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailAccount.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":2},"name":"@accountFeature","id":"6017dbb6-437f-41a3-899c-da8f1736b341"}],"language":"en","keyword":"Feature","name":"Retail Account Page","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":2},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"11697798-53b8-4f36-afd5-b980319c0e60"},{"location":{"line":6,"column":2},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"41def446-88bc-435e-bb52-b2b4f92643da"},{"location":{"line":7,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'test@test.test' and password 'TestTest3#'","id":"1849f643-ed97-411f-badd-a7228b3e18c5"},{"location":{"line":8,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"41da630b-21c6-470c-b87b-c19a18978bc0"},{"location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged in into Account","id":"f395c7b7-81a7-4f6d-bcbf-aa09ee950895"}],"id":"7d84b4da-cbae-40e3-9c05-d3c4015949e0"}},{"scenario":{"location":{"line":12,"column":1},"tags":[{"location":{"line":11,"column":2},"name":"@updateProfile","id":"d956c478-8355-410f-a5e3-def90a9e28d8"}],"keyword":"Scenario","name":"Verify User can update Profile Information","description":"","steps":[{"location":{"line":13,"column":2},"keyword":"When ","keywordType":"Action","text":"User click on Account option","id":"44c3cb77-5b8b-41af-8ea3-a4910b004c90"},{"location":{"line":14,"column":2},"keyword":"An asspath:features/RetailOrder.feature","data":"\t@orderFeature\r\nFeature: Retail Order Page\r\n\r\nBackground:\r\n\tGiven User is on retail website\r\n\tWhen User click on Sign in option\r\n\tAnd User enter email 'test@test.test' and password 'TestTest3#'\r\n\tAnd User click on login button\r\n\tAnd User should be logged in into Account\r\n\r\n\t@addItem\r\nScenario: Verify User can add an item to cart\r\n\tAnd User change the category to 'Smart Home' \r\n\tAnd User search for an item 'kasa outdoor smart plug'\r\n\tAnd User click on Search icon\r\n\tAnd User click on item\r\n\tAnd User select quantity '2'\r\n\tAnd User click add to Cart button\r\n\tThen the cart icon quantity should change to '2'\r\n\t\r\n\t@placeOrder\r\nScenario: Verify User can add item to cart and place order\r\n\tAnd User change the category to 'Electronics' \r\n\tAnd User search for an item 'Apex Legends'\r\n\tAnd User click on Search icon\r\n\tAnd User click on item\r\n\tAnd User select quantity '5'\r\n\tAnd User click on Cart option\r\n\tAnd User click on Proceed to Checkout button\r\n\tAnd User click on Place Your Order\r\n\tThen a message should be displayed 'Order Placed, Thanks'\r\n\t\r\n\t@cancelOrder\r\nScenario: Verify User can cancel the order\r\n\tAnd User click on Orders Section\r\n\tAnd User click on first order in list\r\n\tAnd User click on Cancel Order button\r\n\tAnd User select the cancelation Reason 'Bought wrong item'\r\n\tAnd user click on Cancel Order button on cancellation page\r\n\tThen a cancelation message should be displayed 'Your Order Has Been Cancelled'\r\n\t\r\n\t@returnOrder\r\nScenario: Verify User can Return the order\r\n\tAnd User click on Orders Section\r\n\tAnd User click on first order in list\r\n\tAnd User click on Return Items button\r\n\tAnd User select the Return Reason 'Item damaged'\r\n\tAnd User select the drop off service 'FedEx'\r\n\tAnd User click on Return Order button\r\n\tThen a cancelation message should be displayed 'Return was successful'\r\n\t\r\n\t@writeReview\r\nScenario: Verify User can write a review on order placed\r\n\tAnd User click on Orders Section\r\n\tAnd User click on first order in list\r\n\tAnd User click on Review button\r\n\tAnd User write Review headline 'headline value' and 'review text'\r\n\tAnd User click Add your Review button\r\n\tThen a review message should be displayed 'Your review was added successfully'","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"classpath:features/RetailOrder.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":2},"name":"@orderFeature","id":"314e4efb-bdaf-45cd-9441-a6a532e08cc3"}],"language":"en","keyword":"Feature","name":"Retail Order Page","description":"","children":[{"background":{"location":{"line":4,"column":1},"keyword":"Background","name":"","description":"","steps":[{"location":{"line":5,"column":2},"keyword":"Given ","keywordType":"Context","text":"User is on retail website","id":"28287291-48e0-4ab6-9ddd-c3e04abe9eae"},{"location":{"line":6,"column":2},"keyword":"When ","keywordType":"Action","text":"User click on Sign in option","id":"0d20845e-92e8-4796-af8b-2f6599a257e8"},{"location":{"line":7,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User enter email 'test@test.test' and password 'TestTest3#'","id":"91e05fa0-93f6-4201-801a-485db192ff0a"},{"location":{"line":8,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User click on login button","id":"234cbbaf-ea52-4a15-84a6-53dc7ba7f2c4"},{"location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"User should be logged in into Account","id":"85e5abb6-881c-4691-a523-bd9f5d5969f6"}],"id":"998579b5-bf37-40cc-a0d7-5398b71c9690"}},{"scenario":{"location":{"line":12,"column":1},"tags":[{"location":{"line":11,"column":2},"name":"@addItem","id":"aef3a5b8-5483-46d8-bbb3-e2f956373daa"}],"keyword":"Scenario","name":"Verify User can add an item to cart","description":"","steps":[{
